  `datecode` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '日期碼',
  `quantity` int NOT NULL DEFAULT '0' COMMENT '異動數量',
